import WeatherInfo from "./weather/WeatherInfo";
import Country from "./component1/Country";
import Home from "./component1/Home";
import PageOne from "./pages/PageOne";
import PageTwo from "./pages/PageTwo";
import PageThree from "./pages/PageThree";
import Country1 from "./component1/Country1";
import Main from "./pages/Main";

function App() {
  return (
    <div className="main">
      <div className="brand">
        <img src={image} className="logo" />
        <h2>Trip go where </h2>
        <h1 className="WishList">WishList</h1>
      </div>
      <div className="nav-menu">Welcome to Trip go where App</div>

      <nav>
        <Main />
