        <Route path="/pages-two" element={<PageTwo />} />
        <Route path="/pages-three" element={<PageThree />} />
      </Routes>

      <div>
        <div className="title">
          <img src={image2} className="img2"></img>
        </div>
        <div className="moveup">
          <h1>TRAVEL TO EXPLORE</h1>

          <div className="search">
